CHT-1540-BK CHT-1540-WH <br><table width="700" border="0" cellspacing="0" cellpadding="0"><tr><td><div style="width:auto; border: #CCC solid 1px; font-family:'ヒラギノ角ゴ Pro W3', 'Hiragino Kaku Gothic Pro', 'メイリオ', Meiryo, Osaka, 'ＭＳ Ｐゴシック', 'MS PGothic', sans-serif; font-size:20px;">CHT-1540 暖炉型ヒーター Nostalgie<p style="margin:1px; font-size:12px;">スリーアップ Three-up 暖炉型ファンヒーター CHT1540 ノスタルジア CHT-1540(WH) CHT-1540(BK)</p></div><br /><div align="center" style="font-size:12px;"><TABLE border="0" width="100%"><TBODY><TR><TD align="center"><BR><IMG src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/wat4253-01.jpg" border="0"><BR><img src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/wat4253-02.jpg" border="0" /><BR><IMG src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/wat4253-03.jpg" border="0"><BR><BR><BR><BR><TABLE border="0" cellpadding="6" cellspacing="1" bgcolor="#666666" width="80%"><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">商品名</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">CHT-1540 暖炉型ヒーター<BR>Nostalgie(ノスタルジア)</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">型番/JAN</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">(ホワイト)CHT-1540WH / 4582287778675<BR>(ブラック)CHT-1540BK / 4582287778682</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">サイズ</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">幅40×奥行25×高さ55cm</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">重量</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">8.2Kg</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">材質</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">スチール</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">電源</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">AC100V 50/60Hz</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">消費電力</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">強/1200W、弱/600W</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">コード長</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">1.8m</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">疑似炎用電球</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">シャンデリア電球 口金E12　100/110V 40W</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">機能</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">強/弱(2段階切替)、ヒーター調節、照度調節</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">安全装置</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">温度ヒューズ、サーモスタット、<BR>転倒時自動オフスイッチ</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">電気代(目安)</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">1時間あたり 約32.4円(強/1200W使用時)</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">保証期間</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">1年間(疑似炎用電球を除く)</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">区分</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">家電 暖房器具</font></TD></TR><TR><TD bgcolor="#ffffcc" align="center" width="20%"><font size="2">広告文責</font></TD><TD bgcolor="#ffffff" width="80%"><font size="2">株式会社マツムラカメラ　076-242-1122</font></TD></TR></TABLE><BR><BR><BR><IMG src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/wat4253-00.jpg" border="0"><BR></TD></TR></TBODY></TABLE></div><br /><br /><table width="560" border="1" cellspacing="0" cellpadding="10" bordercolor="#663300"><tr><td><font size="2"><font color="#663300"><strong>CHT-1540 暖炉型ヒーター Nostalgie</strong></font><br /><br />ゆらめく炎がまるで本物の暖炉のような雰囲気を演出する電気式の暖炉ヒーターです。 重厚感のある贅沢なアンティーク調のクラシックデザインは洋室・和室ともにマッチし、 このデザインならではの「ぬくもり」を感じられます。擬似炎ランプの明るさは調節可能なのでライトを暗くすることも可能。本物の暖炉と違い、燃焼を行なわないクリーン暖房です。</font></td><